import DefaultLayout from './layouts/DefaultLayout';
import Ulap from './components/Ulap/ProductFinder/ProductFinder';
import Home from './components/Ulap/Home';
import PlanFinder from './components/Ulap/ProductFinder/ProductFinder';

const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      { path: '/', element: Home },
    ],
  },
  {
    path: '/product-finder',
    element: ProductFinder,
  },
];

export default routes;
